back when a more specific template (e.g. Category: Recipes) cannot be found.'=>'Afișează o arhivă cu categoriile de articole. Acest șablon va servi ca o alternativă când nu poate fi găsit un șablon specific (de exemplu, Categorie: rețete).','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'Afișează o arhivă cu articolele unui singur autor. Acest șablon va servi ca o alternativă când nu poate fi găsit un șablon specific (de exemplu, Autor: administrator).','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'Afișează orice arhivă, inclusiv articolele cu un singur autor, categorii, etichete, taxonomii, tipuri de articol personalizat sau date. Acest șablon va servi ca o alternativă când nu poate fi găsit un șablon specific (de exemplu, Categorie sau Etichetă).','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'Afișează o pagină statică, cu excepția cazului în care a fost aplicat un șablon personalizat acelei pagini sau dacă există un șablon dedicat.','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'Afișează un singur articol pe site, cu excepția cazului în care a fost aplicat un șablon personalizat articolului respectiv sau dacă există un șablon dedicat.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'Afișează orice intrare unică, cum ar fi un articol sau o pagină. Acest șablon va servi ca alternativă când nu poate fi găsit un șablon specific (de exemplu, Articol singular, Pagină sau Atașament).','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'Afișează prima pagină a site-ului tău, indiferent dacă este setată să afișeze cele mai recente articole sau o pagină statică. Șablonul Pagina din față are prioritate față de toate celelalte șabloanele.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'Afișează ultimele articole fie ca prima pagină a site-ului, fie ca o „Pagină Articole”, așa cum este definită în setările Afișare. Dacă există, șablonul Pagina din față contramandează acest șablon când articolele sunt afișate pe prima pagină.','Used as a fallback template for all pages when a more specific template is not defined.'=>'Folosit ca șablon alternativ în toate paginile când nu este definit un șablon specific.','Block pattern categoryAbout'=>'Despre','Block pattern categoryTeam'=>'Echipă','Block pattern categoryPosts'=>'Articole','Block pattern categoryBanners'=>'Bannere','block descriptionThe author name.'=>'Numele autorului.','block titleAuthor Name'=>'Nume autor','block keywordpage'=>'pagină','block descriptionDisplays a page inside a list of all pages.'=>'Afișează o pagină într-o listă cu toate paginile.','block titlePage List Item'=>'Element din lista de pagini','Style Variations'=>'Variante de stil','Position'=>'Poziție','Sticky'=>'Reprezentativ','https://wordpress.org/documentation/article/cookies/'=>'https://wordpress.org/documentation/article/cookies/','https://wordpress.org/documentation/article/reset-your-password/'=>'https://wordpress.org/documentation/article/reset-your-password/','https://wordpress.org/documentation/article/site-editor/'=>'https://wordpress.org/documentation/article/site-editor/','Array of column names to be searched.'=>'Tablou cu nume de coloane care să fie căutate.','The block t