ives to show.'=>'Nicio arhivă de afișat.','The offset number requested is larger than or equal to the number of available revisions.'=>'Numărul cerut este mai mare sau egal cu numărul de revizii disponibile.','Unable to send personal data export confirmation email.'=>'Nu pot trimite emailul de confirmare pentru exportul datelor personale.','[%1$s] Action Confirmed: %2$s'=>'[%1$s] Acțiune confirmată: %2$s','The current user can create terms in the %s taxonomy.'=>'Utilizatorul actual poate crea termeni în taxonomia %s.','The current user can assign terms in the %s taxonomy.'=>'Utilizatorul actual poate atribui termeni în taxonomia %s.','The current user can change the author on this post.'=>'Utilizatorul actual poate schimba autorul acestui articol.','The current user can sticky this post.'=>'Utilizatorul actual poate evidenția acest articol.','The current user can publish this post.'=>'Utilizatorul actual poate publica acest articol.','You have used your space quota. Please delete files before uploading.'=>'Ți-ai folosit cota de spațiu alocată. Te rog șterge niște fișiere înainte de a mai încărca.','Not enough space to upload. %s KB needed.'=>'Nu ai suficient spațiu pentru încărcare. Ai nevoie de %s KO.','The site administrator has been notified. You will receive an email confirmation when they erase your data.'=>'Administratorul site-ului a fost notificat. Vei primi o confirmare prin email după ce ți se șterg datele.','Thanks for confirming your erasure request.'=>'Îți mulțumesc pentru confirmarea cererii de ștergere.','The site administrator has been notified. You will receive a link to download your export via email when they fulfill your request.'=>'Administratorul site-ului a fost notificat. Vei primi o legătură prin email pentru a-ți descărca exportul când cererea ta este onorată.','Thanks for confirming your export request.'=>'Îți mulțumesc pentru confirmarea cererii de export.','Howdy,

