mage file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Dă clic pe &#8222;Adaugă imagine nouă&#8221; pentru a încărca un fișier imagine din computer. Tema ta funcționează cel mai bine cu o imagine cu o dimensiune a antetului de %s de pixeli - după ce o încarci, vei putea să decupezi imaginea ca să se potrivească perfect.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Dă clic pe &#8222;Adaugă imagine nouă&#8221; pentru a încărca un fișier imagine din computer. Tema ta funcționează cel mai bine cu o imagine care se potrivește cu dimensiunile videoului tău - după ce o încarci, vei putea să decupezi imaginea ca să se potrivească perfect.','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'Meridian','Minute'=>'Minut','Hour'=>'Oră','Time'=>'Timp','Day'=>'Zi','Month'=>'Lună','Date'=>'Dată','Usage of user levels is deprecated. Use capabilities instead.'=>'Utilizarea nivelurilor de utilizator este învechită. Folosește în schimb capabilități.','The theme defines itself as its parent theme. Please check the %s header.'=>'Tema însăși se definește ca temă părinte. Te rog vezi antetul %s.','Name for the Visual editor tabVisual'=>'Vizual','Create New Menu'=>'Creează meniu nou','New Menu'=>'Meniu nou','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Dacă tema ta are zone asamblabile, poți adăuga și meniuri acolo. Vizitează <a href="%s">panoul Piese</a> și adaugă o &#8222;piesă Meniu de navigare&#8221; pentru a afișa un meniu într-o bară laterală sau în subsol.','If your theme has multiple menus, giving them clear names will help y